import Link from "next/link"

const Index = () => {
    console.log("RUNNING INDEX COMPONENT");
    return (
        <div>
            <Link href="/about"><button>About Page</button></Link>
            <Link href="/contact"><a>Contact Page</a></Link>
            <h1>My Index Page!! </h1>
        </div>
    );
};

export default Index;
